import React from "react";

const Navbar = ({setPage}) => {
  return (
      <div className="navbar">
        <button className="button-navbar">
          <text className="text-button-navbar" onClick={()=>setPage(1)}>Home</text>
        </button>
        <button className="button-navbar">
          <text className="text-button-navbar" onClick={()=>setPage(2)}>Projects</text>
        </button>
        <button className="button-navbar">
          <text className="text-button-navbar" onClick={()=>setPage(3)}>Work experience</text>
        </button>
        <button className="button-navbar">
          <text className="text-button-navbar" onClick={()=>setPage(4)}>Skills</text>
        </button>
      </div>
  );
};

export default Navbar;
